import React from "react";


const Footer = ()=>{
    return(
        <>
             <div className="container">
                <div className="row">
                    <div className="col-12 bg-success">
                            <p className="text-center text-capitalize p-5">@ all copyrights reserved by Rahul gupta.</p>
                    </div>
                </div>
             </div>
        </>
    );
}

export default Footer;
